INSERT INTO `dsdetails` VALUES ('798', 'Targeting of U.S. companies and government agencies', '08-Oct-2020', 'Fox Kitten', 'Iranian hackers attacked high-end networking equipment with recently reported vulnerabilities that had not yet been patched, providing a â€œbeachheadâ€? for peer hacking groups.', '', 'U.S. government agencies, U.S. companies', 'Iran (Islamic Republic of)', 'Baiting', 'Government, Private sector', 'https://www.cybersafe.news/fbi-warns-about-iranian-hacking-group-attacking-f5-networking-devices/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'jhiap68j');
INSERT INTO `dsdetails` VALUES ('799', 'Tracking of Saudi Arabian citizens in the United States', '3/29/2020', 'Government of Saudi Arabia', 'The Saudi Arabian government used flaws in the global Signaling System 7 (SS7) to track Saudis in the United States by sending requests through Saudi phone companies.', '', 'Saudi Arabian citizens in the Untied States', 'Saudi Arabia', 'Baiting', 'Private sector', 'https://www.theguardian.com/world/2020/mar/29/revealed-saudis-suspected-of-phone-spying-campaign-in-us', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'wheblwm3');
