INSERT INTO `dsdetails` VALUES ('801', 'Pioneer Kitten', '8/31/2020', 'Also known as Parasite, UNC757, and Fox Kitten.', 'Responsible for gathering sensitive and private information relevant to Iran. In addition to stalking Iranian expats and dissidents, Pioneer Kitten has targeted North American and Israeli technology, government, defense, and healthcare organizations. Pioneer Kitten is unlikely to be an official part of the Iranian government, and is more likely contracted to act on its behalf.', '', 'Iranian expats and dissidents, North American and Israeli organizations', 'Iran (Islamic Republic of)', 'Baiting', 'Civil society, Private sector, Government', 'https://www.crowdstrike.com/blog/who-is-pioneer-kitten/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'e2zvhd8v');
INSERT INTO `dsdetails` VALUES ('802', 'Targeting of Burisma', '1/13/2020', 'APT 28', 'The alleged Russian actors hacked Burisma, a Ukrainian gas company whose board Joe Bidens son sat on. President Trump had previously pressed Ukraine to open an investigation into Biden and Burisma, which led to his impeachment.', '', 'Burisma', 'Russian Federation', 'Baiting', 'Private sector', 'https://www.bbc.com/news/world-us-canada-51103556', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'vkn60zzs');
INSERT INTO `dsdetails` VALUES ('803', 'Targeting of  New York Times journalist Ben Hubbard', '1/28/2020', 'KINGDOM', 'The Saudi hackers KINGDOM launched a phishing attack to attempt to trick Â journalist Ben Hubbard into installing NSO Groups Pegasus malware onto his phone. Hubbard does not recall clicking on the infected link sent to him via text message and it is unknown if his phone was infected.', '', 'Ben Hubbard', 'Saudi Arabia', 'Baiting', 'Civil society', 'https://citizenlab.ca/2020/01/stopping-the-press-new-york-times-journalist-targeted-by-saudi-linked-pegasus-spyware-operator/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'r4ht266w');
INSERT INTO `dsdetails` VALUES ('804', 'Targeting of Israeli water management facilities', '7/17/2020', 'Believed to be the work of the Iranian government.', 'Hackers targeted two water pumps in Galilee and Mateh Yehuda. No real-world effects were reported as a result of the hacking operation.Â Israels government stated that no data had been stolen.', 'Confirmation   https://www.ynet.co.il/article/rJrCqmAkw', 'Israel', 'Iran (Islamic Republic of)', 'Vulnerabilities', 'Government', 'https://www.ynet.co.il/article/rJrCqmAkw', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'pnem74ij');
INSERT INTO `dsdetails` VALUES ('805', 'Targeting of Arabic speakers with COVID-19â€“related apps', '4/15/2020', 'Syrian Electronic Army', 'The Syrian Electronic Army distributed numerous COVID-19â€“themed Android mobile apps to Arabic-speaking users.', '', 'Arabic speakers in Syria and surrounding region', 'Syrian Arab Republic', 'Baiting', 'Civil society', 'https://www.cyberscoop.com/coronavirus-syria-surveillance-apps-lookout/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'ez2mdwhp');
