INSERT INTO `dsdetails` VALUES ('808', 'Targeting of Polands War Studies University', '4/23/2020', 'Russia', 'Hackers breached Polands War Studies Universitys website and posted a fake letter from the universitys commander, urging Polish soldiers â€œto fight against the American occupation.â€?', 'Denouncement   https://www.gov.pl/web/sluzby-specjalne/atak-dezinformacyjny-na-polske', 'Polands War Studies University', 'Russian Federation', 'Vulnerabilities', 'Government, Military', 'https://www.cyberscoop.com/poland-cyberattack-russia-us-military/', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '9cx1gdze');
INSERT INTO `dsdetails` VALUES ('809', 'Targeting of Iranian expats and dissidents', '9/18/2020', 'Pioneer Kitten', 'Iranian hackers stole personal documents and two-factor authentication codes from SMS messages, recorded phones surroundings, and used Telegram phishing accounts to target Iranian expats and dissidents.', '', 'Iranian expats and dissidents', 'Iran (Islamic Republic of)', 'Baiting', 'Civil society', 'https://research.checkpoint.com/2020/rampant-kitten-an-iranian-Baiting-campaign/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'z58hjz3g');
