INSERT INTO `dsdetails` VALUES ('811', 'Storm Cloud', '3/31/2020', 'NOTE: Some Moonlight Maze tooling has also been referred to as â€œStorm Cloud.â€? There is no known connection.', 'Performed highly targeted watering-hole attacks on visitors to Tibetan websites.', '', '', 'China', 'Phishing', '', 'https://www.volexity.com/blog/2020/03/31/storm-cloud-unleashed-tibetan-community-focus-of-highly-targeted-fake-flash-campaign/', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', 'icj8srdf');
INSERT INTO `dsdetails` VALUES ('812', 'Targeting of Vatican City computer networks', '7/28/2020', 'RedDelta', 'Hackers conducted an Baiting campaign against Vatican City beginning in May 2020. In one instance, embedded malware was sent using the email of the Vatican Secretary of State. Hackers were likely trying to gain information on the Vaticans negotiating position prior to high-level talks between the Catholic Church and Beijing in September 2020 regarding a provisional agreement concerning the appointment of Catholic bishops in China.Â ', 'Unknown   https://www.ynet.co.il/article/rJrCqmAkw', 'Vatican City, Pontifical Institute for Foreign Missions, Hong Kong Study Mission to China', 'China', 'Phishing', 'Government, Civil society', 'https://www.nytimes.com/2020/07/28/us/politics/china-vatican-hack.html', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', 'z637eh2z');
INSERT INTO `dsdetails` VALUES ('813', 'Targeting of Japan, Russia, and South Korean entities', '03-May-2020', 'Tonto Team', 'The Chinese governmentâ€“aligned APT Tonto Team used Bisonal malware for over ten years in various campaigns against entities in Japan, Russia, and South Korea.', '', 'Japanese, Russian, and South Korean civil society, private sector, and government entities.', 'China', 'Baiting', 'Civil society, Private sector, Government', 'https://blog.talosintelligence.com/2020/03/bisonal-10-years-of-play.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'fqdv3ohv');
