INSERT INTO `dsdetails` VALUES ('816', 'Targeting of U.S. grid', '01-Sep-2020', 'APT 33', 'The Iranian hackers APT 33 targeted the U.S. electric grid with password-spraying attacks, likely in an attempt to gain access. They targeted only the IT side of networks so far and have not proven their ability to access physical systems.', '', 'The U.S. electrical grid', 'Iran (Islamic Republic of)', 'Baiting', 'Private sector', 'https://www.wired.com/story/iran-apt33-us-electric-grid/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'ov3ikon5');
INSERT INTO `dsdetails` VALUES ('817', 'Targeting of Central European aerospace and defense companies', '6/17/2020', 'Believed to be Lazarus Group', 'Hackers impersonated recruiters from Collins Aerospace and General Dynamics to lure in employees with enticing job offers, subsequently tricking them into opening malicious files sent via LinkedIns private messaging app.', '', 'European aerospace and defense firms', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Private sector', 'https://www.eset.com/us/about/newsroom/press-releases/operation-interception-starting-with-a-linkedin-message-threat-actors-went-after-both-secret-inf/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'b13p3mca');
