INSERT INTO `dsdetails` VALUES ('819', 'Stolen data on nearly two thousand Mitsubishi employees', '1/20/2020', 'Bronze Butler', 'The China-linked Bronze Butler threat actor is suspected to have used a zero-day in Trend Micro antivirus to attack Mitsubishi Electric and steal data on thousands of employees.Â In May 2020, it was disclosed that the breach resulted in the theft of specifications for a hypersonic missile that Japan had been developing to protect disputed territory in the East China Sea.', '', 'Mitsubishi Electric employees', 'China', 'Baiting', 'Private sector', 'https://www.zdnet.com/article/trend-micro-antivirus-zero-day-used-in-mitsubishi-electric-hack/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'mgvrwwvg');
INSERT INTO `dsdetails` VALUES ('820', 'Targeting of Tibetans via watering-hole attacks', '3/31/2020', 'Storm Cloud', 'The Chinese hackers Storm Cloud performed highly targeted watering-hole attacks on visitors to a few Tibetan websites and tried to make them install fake versions of Adobe Flash.', '', 'Tibetans', 'China', 'Vulnerabilities', '', 'https://www.volexity.com/blog/2020/03/31/storm-cloud-unleashed-tibetan-community-focus-of-highly-targeted-fake-flash-campaign/', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'un2hby1e');
INSERT INTO `dsdetails` VALUES ('821', 'Targeting of Western entities involved in COVID-19 vaccine development', '7/21/2020', 'Guangdong State Security Department (GSSD) of Chinas Ministry of State Security (MSS)', 'Hackers conducted a combination of financially motivated and Baiting-driven hacking operations against hundreds of companies, organizations, and research firms based in the United States and other countries, stealing terabytes of information.', 'Criminal charges   https://www.politico.com/f/?id=00000173-76e6-d36e-abff-7ffe63dc0000', 'Private Companies, Governments, Nongovernmental Organizations, Individual Dissidents, Clergy, Democratic and Human Rights Activists', 'China', 'Baiting', 'Private sector, Government, Civil society', 'https://www.politico.com/news/2020/07/21/doj-chinese-hackers-coronavirus-research-375855', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'xzsdflcg');
