INSERT INTO `dsdetails` VALUES ('823', 'Targeting of COVID-19 research organizations', '5/13/2020', 'Chinese government', 'Cyber actors affiliated with the Chinese government attempted to identify and illicitly obtain intellectual property and public health data related to vaccines, treatments, and testing from networks and personnel associated with COVID-19â€“related research.', '', 'COVID-19 Research Organizations', 'China', 'Baiting', 'Private sector, Government', 'https://www.cisa.gov/sites/default/files/publications/Joint_FBI-CISA_PSA_PRC_Targeting_of_COVID-19_Research_Organizations_S508C.pdf.pdf', '2d9b83b92f2e776f1739e294b65eb04b68197120', '3eeykk89');
INSERT INTO `dsdetails` VALUES ('824', 'Targeting of Taiwanese government agencies and officials email accounts', '8/19/2020', 'BlackTech', 'Hackers exploited vulnerabilities in at least four Taiwanese tech companies that provided information technology services to the government using the Taidoor malware, allowing them far-reaching access to official systems and accounts since at least 2018.', 'Confirmation   https://www.reuters.com/article/us-taiwan-cyber-china/taiwan-says-china-behind-cyberattacks-on-government-agencies-emails-idUSKCN25F0JK', 'Taiwanese government agencies and officials email accounts', 'China', 'Baiting', 'Government', 'https://www.reuters.com/article/us-taiwan-cyber-china/taiwan-says-china-behind-cyberattacks-on-government-agencies-emails-idUSKCN25F0JK', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'i6e3g3te');
