INSERT INTO `dsdetails` VALUES ('828', 'Spyware sent to Jeff Bezos on WhatsApp', '1/21/2020', 'Government of Saudi Arabia', 'An account belonging to Prince Mohammed bin Salman sent Jeff Bezos spyware masquerading as a video over WhatsApp, which allowed Saudi Arabia to surveil Bezos phone from May 2018 until February 2019. The attack could have been related to Bezos ownership of the Washington Post, whose columnist Jamal Khashoggi was allegedly killed on bin Salmans orders.', '', 'Jeff Bezos', '', 'Baiting', 'Private sector, Civil society', 'https://www.nytimes.com/2020/01/22/world/middleeast/bezos-phone-hacked.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', '1yhxnvoh');
