INSERT INTO `dsdetails` VALUES ('832', 'Targeting of companies in Central Asia', '5/14/2020', 'Vicious Panda', 'A group using tools similar to Chinese governmentâ€“affiliated group Vicious Panda targeted high-profile companies in Central Asia and planting backdoors to gain access to corporate networks. The group is also believed to be behind cyberattacks in Belarus, Mongolia, and Russia.', '', 'Central Asian Businesses', 'China', 'Baiting', 'Private sector, Government', 'https://decoded.avast.io/luigicamastra/apt-group-planted-backdoors-targeting-high-profile-networks-in-central-asia/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'jrz1yd72');
