INSERT INTO `dsdetails` VALUES ('838', 'Targeting of Wuhan government and Chinas Ministry of Emergency Management', '4/22/2020', 'Ocean Lotus', 'Vietnamese hackers sent spear-phishing messages to the Wuhan government and Chinas Ministry of Emergency Management.', '', 'Wuhan government, Chinese Ministry of Emergency Management', 'Vietnam', 'Baiting', 'Government', 'https://www.fireeye.com/blog/threat-research/2020/04/apt32-targeting-chinese-government-in-covid-19-related-Baiting.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'zux1f74d');
INSERT INTO `dsdetails` VALUES ('839', 'Ghostwriter', '7/29/2020', 'Not Applicable', 'Believed to be responsible for conducting a hacking and information operations campaign in Eastern Europe. Hackers compromised websites and email accounts and used them to publish fabricated documents pushing antiâ€“North Atlantic Treaty Organization (NATO) narratives. They then donned fake personas of local officials to promote the fabricated documents on social media.', '', 'Websites and NATO-affiliated officials', 'Russian Federation', 'Vulnerabilities', 'Government, Private sector', 'https://www.fireeye.com/blog/threat-research/2020/07/ghostwriter-influence-campaign.html', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'fluto9ik');
