INSERT INTO `dsdetails` VALUES ('841', 'Disruption of operations at Shahid Rajaee Port', '5/19/2020', 'Israel', 'Israel retaliated against Iran for targeting of Israeli water treatment and sewage facilities by launching a cyberattack against Irans Shahid Rajaee Port, disrupting its operations.', 'Confirmation   https://www.jpost.com/breaking-news/cyber-attack-targets-iranian-port-near-strait-of-hormuz-627616', 'Shahid Rajaee Port in Iran', 'Israel', 'Vulnerabilities', 'Private sector', 'https://www.timesofisrael.com/cyberattack-on-port-suggests-israeli-tit-for-tat-strategy-shows-iran-vulnerable/', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '42zbu6hv');
INSERT INTO `dsdetails` VALUES ('842', 'Targeting of U.S. defense contractors', '8/19/2020', 'Lazarus Group', 'North Korean hackers used fake job postings from leading U.S. defense contractors on LinkedIn to install malicious data-gathering software when clicked.', '', 'U.S. defense contractors', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Government', 'https://us-cert.cisa.gov/ncas/analysis-reports/ar20-232a', '2d9b83b92f2e776f1739e294b65eb04b68197120', '3qdnnwvd');
INSERT INTO `dsdetails` VALUES ('843', 'Targeting of Ukraine with coronavirus phishing emails', '3/13/2020', 'APT 28', 'The Russian hackers Hades (aka APT 28) targeted Ukraine with coronavirus-themed phishing emails. At the same time, viral disinformation about the virus spread in Ukraine, causing riots.', '', 'Ukrainian citizens', 'Russian Federation', 'Baiting', 'Civil society', 'https://www.zdnet.com/article/state-sponsored-hackers-are-now-using-coronavirus-lures-to-infect-their-targets/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'd1k3myo5');
INSERT INTO `dsdetails` VALUES ('844', 'Targeting of email servers using Exim mail transfer agent', '5/28/2020', 'Sandworm', 'Hackers from Sandworm exploited a zero-day vulnerability in Exim mail transfer agent software, which runs on email servers around the world, granting them the ability to remotely execute commands on the compromised servers.', 'Denouncement   https://www.nsa.gov/News-Features/News-Stories/Article-View/Article/2196511/exim-mail-transfer-agent-actively-exploited-by-russian-gru-cyber-actors/', 'Exim mail server users', 'Russian Federation', 'Baiting', 'Private sector, Government, Military, Civil society', 'https://www.nsa.gov/News-Features/News-Stories/Article-View/Article/2196511/exim-mail-transfer-agent-actively-exploited-by-russian-gru-cyber-actors/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '5x6xw8l4');
INSERT INTO `dsdetails` VALUES ('845', 'Penetration of unnamed U.S. federal agency', '9/24/2020', 'APT 28', 'Russian hackers used compromised credentials to install malware and ultimately steal files from unnamed U.S. government agency computers.', 'Confirmation   https://us-cert.cisa.gov/ncas/analysis-reports/ar20-268a', 'U.S. government', 'Russian Federation', 'Baiting', 'Government', 'https://us-cert.cisa.gov/ncas/analysis-reports/ar20-268a', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'y40knklf');
INSERT INTO `dsdetails` VALUES ('846', 'Targeting of U.S. government employees', '1/30/2020', 'APT 34', 'The Iranian state-backed hackers sent out sophisticated spear-phishing lures imitating Westat, a research services company, in hopes of compromising U.S. government employees and networks. They could have also intended to compromise actual Westat employees.', '', 'U.S. government employees and possibly Westat employees', 'Iran (Islamic Republic of)', 'Baiting', 'Government, Private sector', 'https://intezer.com/blog/apt/new-iranian-campaign-tailored-to-us-companies-uses-updated-toolset/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '35b30x24');
INSERT INTO `dsdetails` VALUES ('847', 'Targeting of government bodies in Australia and Southeast Asia', '05-Jul-2020', 'APT 30', 'Using a new exploit named Aria-body, APT 30 attempted to compromise networks belonging to governments and state-owned companies in Australia and Southeast Asia.', '', '', 'China', 'Baiting', 'Government, Private sector', 'https://research.checkpoint.com/2020/naikon-apt-cyber-Baiting-reloaded/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'q7duzz7a');
INSERT INTO `dsdetails` VALUES ('848', 'Targeting of websites in Latvia, Lithuania, and Poland', '7/29/2020', 'Ghostwriter', 'Hackers targeted websites and email accounts in Latvia, Lithuania, and PolandÂ to publish fabricated documents pushing antiâ€“North Atlantic Treaty Organization (NATO) narratives consistent with Kremlin talking points.', '', 'Latvia, Lithuania, Poland', 'Russian Federation', 'Vulnerabilities', 'Private sector', 'https://www.fireeye.com/blog/threat-research/2020/07/ghostwriter-influence-campaign.html', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'ruofur0a');
INSERT INTO `dsdetails` VALUES ('849', 'Phishing with fake coronavirus health advisory', '3/16/2020', 'APT 36', 'The Pakistani governmentâ€“aligned threat actor APT 36 used a fake coronavirus health advisory to phish its targets and deliver a RAT.', '', 'Likely Indian government or civil society targets based on past targeting.', 'Pakistan', 'Baiting', 'Not Applicable', 'https://twitter.com/RedDrip7/status/1237983760802394112', '2d9b83b92f2e776f1739e294b65eb04b68197120', '9vdup3ov');
INSERT INTO `dsdetails` VALUES ('850', 'Targeting of CPC Corporation', '05-May-2020', 'Winnti Umbrella', 'China-linked Winnti Umbrella launched a ransomware attack against Taiwans state oil company, CPC Corporation, causing its website to go offline for one day.', 'Confirmation   https://www.cyberscoop.com/cpc-ransomware-winnti-taiwan-china/', 'CPC Corporation', 'China', 'Vulnerabilities', 'Private sector', 'https://www.cyberscoop.com/cpc-corp-ransomware-attack-taiwan-trend-micro/', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'ui5q167v');
INSERT INTO `dsdetails` VALUES ('851', 'Targeting of UN officials', '8/28/2020', 'Kimsuky', 'North Korean hackers launched a spear-phishing campaign that disguised malware as UN security alerts and interview requests. At least twenty-eight UN officials, eleven of whom represented six members of the UN Security Council, were targeted.', '', 'UN officials, including those affiliated with the UN Security Council', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Government', 'https://undocs.org/S/2020/840', '2d9b83b92f2e776f1739e294b65eb04b68197120', '6bypgad5');
INSERT INTO `dsdetails` VALUES ('852', 'Disclosure by Japanese firms of breaches between 2015 and 2018', '02-Jun-2020', 'Unknown, suspected Bronze Butler.', 'The Japanese defense contractors Pasco and Kobe Steel disclosed security breaches that happened between 2015 and 2016 and in May 2018. Kobe steel supplies submarine parts to the Japan Self-Defense Forces and Pasco provides satellite data. Nikkei suspects that Bronze Butler could have been involved.', '', 'Japanese defense contractors', 'China', 'Baiting', 'Private sector', 'https://www.bleepingcomputer.com/news/security/japanese-defense-contractors-kobe-steel-pasco-disclose-breaches/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '3se1wp8o');
