INSERT INTO `dsdetails` VALUES ('854', 'Infection of computer systems belonging to universities in Hong Kong', '1/31/2020', 'Winnti Umbrella', 'The Winnti Umbrella, a Chinese government-backed threat actor, installed malware on computer systems at two universities in Hong Kong during protests. Three other universities in Hong Kong could have been simultaneously targeted.', '', 'Universities in Hong Kong', 'China', 'Baiting', 'Civil society', 'https://www.welivesecurity.com/2020/01/31/winnti-group-targeting-universities-hong-kong/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'gx5mw6jo');
