INSERT INTO `dsdetails` VALUES ('856', 'Targeting of entities focusing on Taiwan', '08-Aug-2020', 'Believed to be the work of the Chinese government.Â ', 'Hackers targeted various entities involved in Taiwan-related issues with spear-phishing emails containing Taidoor, a remote-access trojan (RAT) designed to maintain a presence on victim networks for use in later network exploitation.', '', 'Government agencies, Private sector companies, Think tanks', 'China', 'Baiting', 'Government, Private sector, Civil society', 'https://us-cert.cisa.gov/ncas/current-activity/2020/08/03/chinese-malicious-cyber-activity', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'tna157ob');
INSERT INTO `dsdetails` VALUES ('857', 'Global phishing campaign against industrial, government, and civil society targets', '3/20/2020', 'APT 28', 'The Russian threat actor APT 28 used phishing campaigns to steal credentials from organizations across the world, in government, private sector, and civil society. They also searched the internet for vulnerable webmail servers.', '', 'Targets across sectors and throughout the world, but especially defense sector and the United Arab Emirates.', 'Russian Federation', 'Baiting', 'Private sector, Government, Civil society, Military', 'https://www.zdnet.com/article/apt28-has-been-scanning-and-exploiting-vulnerable-email-servers-for-more-than-a-year/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'igpd93oh');
