INSERT INTO `dsdetails` VALUES ('882', 'Compromise of Indian nuclear power plant', '11-Dec-2019', 'Lazarus Group', 'Devices on a noncritical administrative network in a nuclear power plant in Tamil Nadu, India, were compromised by DTrack, a remote access Trojan (RAT) associated with the Lazarus Group.', '', 'Noncritical devices in an Indian nuclear power plant', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Government', 'https://dragos.com/blog/industry-news/assessment-of-reported-malware-infection-at-nuclear-facility/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'v8vpuyum');
INSERT INTO `dsdetails` VALUES ('883', 'Attempted attack on the Democratic National Convention (DNC) during 2018 elections', '1/18/2019', 'Suspected to be the work of the Dukes.Â ', 'The DNC alleged it was targeted in an unsuccessful cyberattack eight days after the 2018 elections in an attempted spear-phishing campaign.', '', 'Democratic National Committee', 'Russian Federation', 'Baiting', 'Civil society', 'https://www.wsj.com/articles/dnc-says-russia-tried-to-hack-into-its-computer-network-days-after-2018-midterms-11547831410', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'p2h8p5bm');
INSERT INTO `dsdetails` VALUES ('884', 'Targeting of over sixty universities in multiple countries, including the United States and United Kingdom', '09-Nov-2019', 'Believed to be the work of Cobalt Dickens.', 'A threat actor launched a phishing operation with spoofed login pages to steal the credentials of users at over sixty universities in the United States, United Kingdom, and elsewhere.', '', 'United States, United Kingdom, Australia, Canada, Hong Kong, Switzerland', 'Iran (Islamic Republic of)', 'Baiting', 'Civil society, Private sector', 'https://www.secureworks.com/blog/cobalt-dickens-goes-back-to-school-again', '2d9b83b92f2e776f1739e294b65eb04b68197120', '3538jmqd');
INSERT INTO `dsdetails` VALUES ('885', 'Attack on forum of Hong Kong protesters', '12-Apr-2019', 'Chinese government', 'Chinas government used its â€œGreat Cannonâ€? distributed denial of service (DDOS) system for the first time in two years to attack a forum where Hong Kong residents organized protests.', '', 'Hong Kong protesters', 'China', 'Denial of service', 'Civil society, Private sector', 'https://www.zdnet.com/article/china-resurrects-great-cannon-for-ddos-attacks-on-hong-kong-forum/', '21e1e7111eaa19085ae6c5f0be7d09a3f355e7b1', 'o7j6xq4s');
INSERT INTO `dsdetails` VALUES ('886', 'Compromise of Bayer Pharmaceuticals', '04-Apr-2019', 'Wicked Panda', 'A threat actor put malicious software on Bayers computer system but did not steal any information, as reported by the company.', '', 'Bayer Pharmaceuticals', 'China', 'Phishing', 'Private sector', 'https://www.cyberscoop.com/bayer-breached-china-wicked-panda/', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', 'dqoq5mpk');
INSERT INTO `dsdetails` VALUES ('887', 'Targeting of senior members of Tibetan groups', '9/24/2019', 'Believed to be the work of Poison Carp.', 'A threat actor aimed to infect mobile phones belonging to senior members of Tibetan groups, including people who worked directly for the Dalai Lama and lawmakers in Tibets parliament. The threat actor posed as a human rights worker or journalist and contacted victims through WhatsApp. The campaign involved Android browser vulnerabilities and Android and iOS spyware. The tools appeared in similar attacks, discovered in September, carried out against Chinas Uighur population.', '', 'Tibet', 'China', 'Baiting', 'Civil society, Government', 'https://www.cyberscoop.com/tibet-citizen-lab-spyware-Baiting/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '6gjepq1h');
INSERT INTO `dsdetails` VALUES ('888', 'Hijacking of Iranian hacking infrastructure', '10/21/2019', 'Turla', 'The Russian threat actor Turla took over an Iranian Baiting operation belonging to Iranian-linked APT 34 (aka Oilrig) and used it to attack a number of targets while masquerading as Iran.', '', 'Military, government, scientific organizations, and universities in the Middle East and across the world', 'Russian Federation', 'Baiting', 'Military, Government, Civil society', 'https://www.ft.com/content/b947b46a-f342-11e9-a79c-bc9acae3b654', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'y9lq830w');
INSERT INTO `dsdetails` VALUES ('889', 'Targeting of German energy technology, chemicals, and consumer goods companies, among others', '7/24/2019', 'Believed to be the work of Winnti.', 'A threat actor used aÂ Trojan horse to gainÂ remote backdoor access to German energy technology company Siemens, chemical firm BASF, and consumer goods company Henkel. Non-German companies Roche, Lion Air, and Marriott were also targeted.', '', 'Germany', 'China', 'Baiting', 'Private sector', 'https://www.reuters.com/article/us-germany-cyber/basf-siemens-henkel-roche-target-of-cyber-attacks-idUSKCN1UJ147', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'vb5qxq3u');
INSERT INTO `dsdetails` VALUES ('890', 'Targeting of nongovernmental organizations and political and law enforcement agencies in East and South Asia', '12/29/2019', 'Bronze President', 'The China-affiliated threat actor Bronze President attacked nongovernmental organizations, political agencies, and law enforcement in Mongolia and India, among other countries.', '', '', 'China', 'Baiting', 'Government, Civil society', 'https://www.secureworks.com/research/bronze-president-targets-ngos', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'g2phfpbd');
INSERT INTO `dsdetails` VALUES ('891', 'Targeting of U.S. university and think tank with BabyShark malware', '2/22/2019', '', 'A threat actor used the malware BabyShark, which uses infrastructure associated with North Korean campaigns. The malware was delivered in November 2018 via spear-phishing emails written to appear as though they were sent from a nuclear security expert who works as a consultant for the U.S. government. The subject of the emails referenced North Koreas nuclear program.', '', '', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Private sector', 'https://unit42.paloaltonetworks.com/new-babyshark-malware-targets-u-s-national-security-think-tanks/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '3hh2r4vc');
INSERT INTO `dsdetails` VALUES ('892', 'Bypassing of two-factor authentication', '12/19/2019', 'APT 20', 'A China-aligned attacker bypassed virtual private network (VPN) accounts protected by two-factor authentication to attack governments and managed service providers in a multitude of industries.', '', 'Governments and managed service providers in the U.S., Brazil, China, France, Germany, Italy, Mexico, Portugal, Spain, and the United Kingdom', 'China', 'Baiting', 'Government, Private sector', 'https://resources.fox-it.com/rs/170-CAK-271/images/201912_Report_Operation_Wocao.pdf', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'c64o6wcd');
INSERT INTO `dsdetails` VALUES ('893', 'Operation Soft Cell', '6/25/2019', 'APT 10', 'This threat actor hacked global telecommunications companies for personal data of government officials, activists, and dissidents of interest to Beijing.', '', 'Global telecommunications companies', 'China', 'Baiting', 'Private sector', 'https://www.cybereason.com/blog/operation-soft-cell-a-worldwide-campaign-against-telecommunications-providers', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'ombi1ckv');
INSERT INTO `dsdetails` VALUES ('894', 'Poison Carp', '9/24/2019', 'Also known as Evil Eye', 'This threat actor has targeted senior members of Tibetan groups by sending malicious links in WhatsApp messages, while posing as nongovernmental organization workers, journalists, or other fake personas.', '', 'Tibetans , Uighurs', 'China', 'Baiting', 'Civil society, Government', 'https://www.volexity.com/blog/2019/09/02/digital-crackdown-large-scale-surveillance-and-exploitation-of-uyghurs/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'ocr1ttcz');
INSERT INTO `dsdetails` VALUES ('895', 'Targeting of Avast', '10/21/2019', 'Government of China', 'China-aligned hackers breached Czech-based Avasts network, aiming to compromise the CCleaner tool, which had previously been compromised in 2017.', '', 'Avast', 'China', 'Baiting', 'Private sector', 'https://www.reuters.com/article/us-avast-cyber/avast-target-of-cyber-security-attack-company-and-czech-counterintelligence-say-idUSKBN1X01KS', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'exbdg3x9');
INSERT INTO `dsdetails` VALUES ('896', 'Targeting of investigative journalists at Bellingcat', '7/26/2019', 'Believed to be the work of Fancy Bear.', 'A threat actor conducted a phishing attack on investigative journalists at Bellingcat who have been probing Russian intelligence activities.', '', '', 'Russian Federation', 'Baiting', 'Private sector', 'https://www.ft.com/content/876fb2d8-af92-11e9-8030-530adfa879c2', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'dnv95tal');
INSERT INTO `dsdetails` VALUES ('897', 'Compromise of Kazakh individuals', '11/23/2019', 'Golden Falcon', 'The Russian-speaking threat actor Golden Falcon used a combination of purchased and developed tools to compromise numerous individuals in Kazakhstan and a few in China.', '', 'Numerous Kazakh government officials and private individuals and some Chinese individuals', '', 'Baiting', 'Government', 'https://www.zdnet.com/article/extensive-hacking-operation-discovered-in-kazakhstan/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'b0u85c70');
INSERT INTO `dsdetails` VALUES ('898', 'Targeting of U.S. and European think tanks', '1/31/2019', 'Believed to be the work of Fancy Bear.', 'HackersÂ set up fake login pages or sentÂ spoof e-mails to people who work with the think tanks in an attempt to trick them into handing over information, such as passwords.', '', 'Center for Strategic and International Studies, German Council on Foreign Relations, The Aspen Institutes in Europe, The German Marshall Fund', 'Russian Federation', 'Baiting', 'Private sector', 'https://www.cnn.com/2019/01/30/politics/fancy-bear-microsoft-csis-think-tank/index.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'xg1cnlot');
INSERT INTO `dsdetails` VALUES ('899', 'Autumn Apertureâ€”use of malicious websites to target foreign ministries and other entities', '8/22/2019', 'Believed to be the work of Kimusky, also known as Thallium and Smoke Screen.', 'A threat actor targeted a number of foreign ministries, a Chinese technology company, Stanford University, think tanks in the United States and the United Kingdom, and other entities that have focused on North Koreas nuclear efforts or the related international sanctions. The threat actor created a network of malicious websites imitating the login portals of targets. This incident is believed to be an extension of the 2018 BabyShark campaign.', '', 'French Ministry for Europe and European Affairs, Ministry of Foreign and European Affairs of the Slovak Republic, Stanford University, Sina, Foreign ministry of the South African government', 'Korea (Democratic Peoples Republic of)', 'Denial of service', 'Government, Private sector', 'https://www.cyberscoop.com/north-korean-hacking-Baiting-phishing/', '21e1e7111eaa19085ae6c5f0be7d09a3f355e7b1', 's6hkr5un');
INSERT INTO `dsdetails` VALUES ('900', 'Surveillance of individuals in the United Arab Emirates (UAE) and globally', '12/22/2019', 'Government of the UAE', 'ToTok, a popular Emirati messaging app, was revealed to be a mass surveillance tool used by the Emirati government.', '', 'Millions of individuals in the UAE and globally', 'United Arab Emirates', 'Baiting', 'Civil society', 'https://www.nytimes.com/2019/12/22/us/politics/totok-app-uae.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', '4amtvxzk');
INSERT INTO `dsdetails` VALUES ('901', 'Attack on Iranian computer systems', '6/22/2019', 'U.S. Cyber Command', 'U.S. Cyber Command hacked Iranian rocket and missile launch systems in retaliation for the downing of a U.S. drone and attacks on oil tankers in the Strait of Hormuz. Iranian officials said the attack was not successful.', 'Denouncement   https://www.reuters.com/article/us-mideast-iran-usa-cyber-idUSKCN1TP0B1?utm_campaign=trueAnthem%3A%20Trending%20Content&amp;utm_content=5d10beeeb35fc8000145c351&amp;utm_medium=trueAnthem&amp;utm_source=twitter', 'Iranian rocket and missile launch systems', 'United States', 'Vulnerabilities', 'Military', 'https://www.nytimes.com/2019/06/22/us/politics/us-iran-cyber-attacks.html', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'cn0kn959');
INSERT INTO `dsdetails` VALUES ('902', 'Targeting of Czech Foreign Ministry', '8/31/2019', 'Russian military intelligence agency, known as GRU', 'A threat actor launched a persistent campaign against the Foreign Ministry of the Czech Republic that lasted several months. This campaign follows previous attacks on the Czech Foreign Ministry in 2018 and 2017.', '', 'Foreign Ministry of the Czech Republic', 'Russian Federation', 'Baiting', 'Government', 'https://www.reuters.com/article/us-czech-security-cyber/foreign-power-was-behind-cyber-attack-on-czech-ministry-senate-idUSKCN1V31DS?il=0', '2d9b83b92f2e776f1739e294b65eb04b68197120', '9g3cof9e');
INSERT INTO `dsdetails` VALUES ('903', 'Large-scale attacks against Georgia', '10/28/2019', 'Sandworm', 'Russian group Sandworm carried out large-scale cyberattacks against targets in Georgia.', '', 'Georgian government, courts, nongovernmental organizations, media, and businesses', 'Russian Federation', 'Vulnerabilities', 'Government, Private sector, Civil society', 'https://www.nytimes.com/2020/02/20/world/europe/georgia-cyberattack-russia.html', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'alhsujpa');
INSERT INTO `dsdetails` VALUES ('904', 'Targeting of U.S. utility companies', '08-Jan-2019', 'Unnamed state-sponsored APT', 'Between July 19 and July 25, 2019, a threat actor sent several spear-phishing emails to three U.S. companies in the utility sector. The emails were sent from a domain impersonating that of the National Council of Examiners for Engineering and Surveying, an authority in the industry. The emails contained Microsoft Word attachments that used macros to install and run a new remote-access Trojan (RAT) called LookBack.', '', 'United States', '', 'Baiting', 'Private sector', 'https://www.proofpoint.com/us/threat-insight/post/lookback-malware-targets-united-states-utilities-sector-phishing-attacks', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'r9eum17i');
INSERT INTO `dsdetails` VALUES ('905', 'Golden Falcon', '11/23/2019', 'Also known as DustSquad, Russian-speaking but may be Kazakh.', 'Threat actor that has targeted Kazakh government officials and private individuals, along with some Chinese individuals.', '', '', '', 'Denial of service', '', 'https://www.zdnet.com/article/extensive-hacking-operation-discovered-in-kazakhstan/', '21e1e7111eaa19085ae6c5f0be7d09a3f355e7b1', '5bxehi06');
INSERT INTO `dsdetails` VALUES ('906', 'Targeting of Visma', '02-Jun-2019', 'Believed to be the work of APT 10.', 'Hackers used malware from the dark web to target a Norwegian internet service provider. The goal of the attack was to gain access to customers intellectual property, strategic plans, and emails.', '', 'Visma', 'China', 'Baiting', 'Private sector', 'https://www.recordedfuture.com/apt10-cyberBaiting-campaign/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '72kub3kd');
INSERT INTO `dsdetails` VALUES ('907', 'Autumn Apertureâ€”malware embedded in antiquated file types', '09-Nov-2019', 'Believed to be the work of Kimusky, also known as Thallium and Smoke Screen.', 'A threat actor targeted U.S.-based entities by emailing them malware-laced Microsoft Word documents written by industry experts. The trojanized documents discussed nuclear deterrence, North Koreas nuclear submarine program, and economic sanctions on the North Korean regime. This incident is believed to be an extension of the August Autumn Aperture campaign.', '', 'Unnamed U.S.-based entities', 'Korea (Democratic Peoples Republic of)', 'Denial of service', 'Private sector', 'https://blog.prevailion.com/2019/09/autumn-aperture-report.html', '21e1e7111eaa19085ae6c5f0be7d09a3f355e7b1', 'e226jmmu');
INSERT INTO `dsdetails` VALUES ('908', 'Targeting of industrial control systems', '11/23/2019', 'APT 33', 'Iran-aligned threat actor APT 33 targeted industrial control system manufacturers, suppliers, and maintainers.', '', 'Industrial control systems manufacturers, suppliers, and maintainers', 'Iran (Islamic Republic of)', 'Baiting', 'Private sector', 'https://arstechnica.com/information-technology/2019/11/a-notorious-iranian-hacking-crew-is-targeting-industrial-control-systems/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'v5oh0haa');
