INSERT INTO `dsdetails` VALUES ('910', 'Targeting of telecommunications operators in countries through which Uighurs are known to travel', '09-May-2019', 'Believed to be the work of Chinese state-sponsored hackers.', 'Multiple threat actors compromised telecoms networks across Central and Southeast Asia. The attacks were part of a wider cyber-Baiting campaign targeting diplomats and state officials, and they signal Chinas ability and intent to track the movements of Uighurs along a number of transit routes that they use to escape state persecution.', '', '', 'China', 'Baiting', 'Civil society', 'https://www.reuters.com/article/us-china-cyber-uighurs/china-hacked-asian-telcos-to-spy-on-uighur-travelers-sources-idUSKCN1VQ1A5', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'qwr03j43');
INSERT INTO `dsdetails` VALUES ('911', 'Targeting of Japanese organizations', '10-Feb-2019', 'APT 17 and Bronze Butler', 'Two Chinese government threat actors used a number of zero-day vulnerabilities in common Japanese software to target Japanese organizations over the course of several years.', '', 'Japanese organizations', 'China', 'Baiting', 'Private sector', 'https://threatpost.com/virus-bulletin-japanese-attacks-apt-strategygy/148859/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'n6b0r92e');
INSERT INTO `dsdetails` VALUES ('912', 'Targeting of Internet of Things (IoT) devices used by Microsoft customers', '08-May-2019', 'Believed to be the work of Strontium, also known as APT 28 and Fancy Bear.', 'The threat actor exploited office devices weak, outdated security to access the networks of several Microsoft customers and infiltrate accounts with more privileges.', '', '', 'Russian Federation', 'Phishing', 'Private sector', 'https://www.forbes.com/sites/zakdoffman/2019/08/05/microsoft-warns-russian-hackers-can-breach-companies-through-millions-of-simple-iot-devices/#51543552617f', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', 'nqkw5v3w');
