INSERT INTO `dsdetails` VALUES ('914', 'U.S. Cyber Command offensive attack of Russian troll farm', '2/27/2019', 'U.S. Cyber Command', 'In November 2018, the U.S. Cyber Command launched an offensive campaign to combat a Russian troll operation known for using disinformation tactics.', '', 'Russia', 'United States', 'Denial of service', 'Government', 'https://www.washingtonpost.com/world/national-security/us-cyber-command-operation-disrupted-internet-access-of-russian-troll-factory-on-day-of-2018-midterms/2019/02/26/1827fc9e-36d6-11e9-af5b-b51b7ff322e9_story.html?utm_term=.9be95dc8f486', '21e1e7111eaa19085ae6c5f0be7d09a3f355e7b1', 'xn2pk1qg');
