INSERT INTO `dsdetails` VALUES ('919', 'APT 41', '08-Jul-2019', 'Not Applicable', 'This threat actor has, since 2014, conducted operations backed by the Chinese government, including targeting the health-care and high-tech sectors and conducting Baiting against political dissidents. It has simultaneously conducted its own for-profit illicit activity in the video games industry, amassing millions of dollars in digital currency to be sold to gamers on the black market. The threat actor operates outside of state control but is linked to other Chinese APT malware actors and tools on a part-time or contractual basis, or is a full-time, state-sponsored APT actor that simultaneously conducts nonstate campaigns for supplemental income. This threat actor is a notable example of the blurring lines between state-sponsored and commercial cyber criminals.', '', 'United States, France, Japan, Singapore, United Kingdom, Hong Kong', 'China', 'Baiting', 'Government, Private sector', 'https://content.fireeye.com/apt-41/rpt-apt41/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '0uumg6hp');
INSERT INTO `dsdetails` VALUES ('920', 'Targeting of Ukrainian government entities', '11/25/2019', 'Gamaredon', 'Gamaredon, a Russian-speaking APT, targeted Ukrainian government entities from September to November 2019.', '', '', '', 'Baiting', 'Not Applicable', 'Not Applicable', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'eujbxdqi');
INSERT INTO `dsdetails` VALUES ('921', 'Targeting of universities maritime military secrets', '03-May-2019', 'Believed to be the work of Leviathan.', 'Chinese hackers targeted twenty-seven universities in the United States, Canada, and Southeast Asia as part of a scheme to steal research about maritime technology under development for military use.', '', 'University of Hawaii, University of Washington, Massachusetts Institute of Technology , Pennsylvania State University, Duke University', 'China', 'Baiting', 'Civil society, Private sector', 'https://www.wsj.com/articles/chinese-hackers-target-universities-in-pursuit-of-maritime-military-secrets-11551781800', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'z3ock8ar');
INSERT INTO `dsdetails` VALUES ('922', 'Targeting of a U.S. presidential campaign', '10-Apr-2019', 'Believed to be the work of Phosphoros, also known as APT 35', 'A threat actor targeted the email accounts of an unnamed U.S. presidential campaign, current and former U.S. officials and journalists, and others. During a thirty-day period in August and September, Microsoft observed more than 2,700 attempts to identify the emails of specific customers and 241 hacks.Â  Four accounts were compromised, though not those connected to the presidential campaign or the officials. A threat actor linked to the Iranian government unsuccessfully attempted to break into President Donald J. Trumps reelection campaign, according to sources familiar with the incident.Â ', '', 'An unnamed U.S. presidential campaign', 'Iran (Islamic Republic of)', 'Baiting', 'Government', 'https://www.bloomberg.com/news/articles/2019-10-04/microsoft-says-iran-tried-to-hack-a-u-s-presidential-campaign', '2d9b83b92f2e776f1739e294b65eb04b68197120', '5kjcegd2');
INSERT INTO `dsdetails` VALUES ('923', 'Targeting of U.S. manufacturing group', '11/13/2019', 'Government of China', 'Chinese government hackers attacked the National Association of Manufacturers to steal information that might be useful in U.S.-China trade negotiations.', '', 'National Association of Manufacturers', 'China', 'Baiting', 'Civil society', 'https://www.reuters.com/article/us-usa-trade-china-cyber-exclusive/exclusive-u-s-manufacturing-group-hacked-by-china-as-trade-talks-intensified-sources-idUSKBN1XN1AY?il=0', '2d9b83b92f2e776f1739e294b65eb04b68197120', 't33cp9li');
