INSERT INTO `dsdetails` VALUES ('926', 'Compromise of Bahraini government agencies and critical infrastructure', '08-Jul-2019', 'Not Applicable', 'A threat actor broke into the systems of Bahrains National Security Agency, Ministry of Interior, and office of the first deputy prime minister. On July 25, 2019, Bahraini authorities detected intrusions into its electric and water authority that shut down several systems. The attacks were similar to two hacks in 2012, in which the Shamoon virus was used to knock Qatars natural gas firm RasGas offline and wipe data from the hard drives at Saudi Aramco, Saudi Arabias national oil company.', '', 'Bahrain', 'Iran (Islamic Republic of)', 'Vulnerabilities', 'Government, Private sector', 'https://www.wsj.com/articles/high-level-cyber-intrusions-hit-bahrain-amid-tensions-with-iran-11565202488', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', 'gxvpwxt7');
