INSERT INTO `dsdetails` VALUES ('928', 'Whitefly', '03-Jun-2019', 'Believed to be behind the Singapore health-care breach in July 2018.', 'This threat actor has been active since mid-2017, targeting mainly health-care, media, telecommunications, and engineering organizations in Singapore, in addition to multinational companies with a presence in the country. The group has also targeted defense, telecommunications, and energy companies in Russia, the United Kingdom, and Southeast Asia. The group relies on a combination of custom malware, open-source hacking tools, and legitimate applications to achieve its goals.', '', 'Singapore, Russia, United Kingdom', '', 'Phishing', 'Government, Private sector', 'https://www.securityweek.com/massive-singapore-healthcare-breach-linked-whitefly-cyberspy-group', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', '2upfe8g2');
INSERT INTO `dsdetails` VALUES ('929', 'Targeting of Indian space agency', '11-Jul-2019', 'The Lazarus Group', 'North Korean hackers attacked the Indian Space Research Organization as part of a broader assault on Indias government agencies.', '', 'Indian Space Research Organization', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Government', 'https://www.ft.com/content/ac6a8782-ffad-11e9-b7bc-f3fa4e77dd47', '2d9b83b92f2e776f1739e294b65eb04b68197120', '8mbh0e9z');
