INSERT INTO `dsdetails` VALUES ('934', '2019 Indonesian elections', '03-Dec-2019', 'Believed to be the work of Russian and Chinese hackers.', 'Senior Indonesian election officials accused Chinese and Russian hackers of manipulating and modifying Indonesias voter data base to disrupt the presidential elections.', '', 'Indonesia', 'China, Russian Federation', 'Baiting', 'Government', 'https://www.bloomberg.com/news/articles/2019-03-12/indonesia-says-poll-under-attack-from-chinese-russian-hackers', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'gjgx2bpa');
INSERT INTO `dsdetails` VALUES ('935', 'Compromise of Airbus suppliers', '9/26/2019', 'Believed to be the work of APT 10 or the Jiangsu Province Ministry of State Security.', 'A threat actor targeted virtual private networks (VPNs) used by suppliers of European aerospace company Airbus with a series of attacks. The attacks resulted in unauthorized access to data, including the theft of documents related to Airbuss military transport plane A400M, designed with one of the most powerful propeller engines in the world.', '', 'Airbus', 'China', 'Baiting', 'Private sector', 'https://www.france24.com/en/20190926-airbus-hit-by-series-of-cyber-attacks-on-suppliers', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'pg7hid1a');
