INSERT INTO `dsdetails` VALUES ('940', 'Compromise of websites related to Uighur communities', '09-Mar-2019', 'Believed to be the work of at least two unnamed APT groups, including Evil Eye', 'Multiple threat actors compromised and exploited eleven websites that published news and cultural information related to the Uighur populations in China, particularly the East Turkestan region. The threat actors imitated the domains of Google, the Turkistan Times, and the Uyghur Academy, and used Google applications to gain access to Gmail accounts. Among other sensitive details collected were the hacked devices unique identification numbers, phone numbers, locations, central processing unit (CPU) data, and usernames.', '', 'China', 'China', 'Baiting', 'Civil society', 'https://www.cyberscoop.com/china-uyghur-hacking-china-android-iphone/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'they9j06');
INSERT INTO `dsdetails` VALUES ('941', 'Targeting of BMW and Hyundai', '12-Jun-2019', 'Ocean Lotus', 'Ocean Lotus (aka APT 32), a threat actor aligned with the Vietnamese government, attacked BMW and Hyundai in an attempt to steal automotive trade secrets.', '', 'BMW and Hyundai', 'Vietnam', 'Baiting', 'Private sector', 'https://www.zdnet.com/article/bmw-and-hyundai-hacked-by-vietnamese-hackers-report-claims/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'iznqy1ln');
INSERT INTO `dsdetails` VALUES ('942', 'Chinese intelligence repurposed NSA tools to attack private companies', '05-Jun-2019', 'APT 3', 'The threat actor repurposed hacking tools used against them by the U.S. National Security Agency (NSA) to attack private companies in Asia and Europe. These attacks went undetected for two years.', '', 'Belgium, Luxembourg, The Philippines, and Vietnam', 'China', 'Baiting', 'Private sector', 'https://www.symantec.com/blogs/threat-intelligence/buckeye-windows-zero-day-exploit', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'dbbtfhm0');
