INSERT INTO `dsdetails` VALUES ('957', 'Targeting of European ministries', '10/17/2019', 'the Dukes', 'Believed to have gone dark, Russian threat actor the Dukes targeted the ministries of foreign affairs of three European countries and a European Union (EU) country embassy in the United States with malware.', '', 'Ministries of foreign affairs of three European countries and an EU country embassy in the United States', 'Russian Federation', 'Baiting', 'Government', 'https://www.welivesecurity.com/wp-content/uploads/2019/10/ESET_Operation_Ghost_Dukes.pdf', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'lwld8z0t');
