INSERT INTO `dsdetails` VALUES ('965', 'Stealth Mango and Tangelo', '5/15/2018', 'Not Applicable', 'This threat actor, which consists of Stealth Mango (Android) and Tangelo (iOS), targets government officials, diplomats, military personnel, and activists in primarily Afghanistan, India, Iraq, Pakistan, and the United Arab Emirates for Baiting.', '', 'Pakistan, Afghanistan, India, Iraq, United Arab Emirates, United States, Australia, Germany', 'Pakistan', 'Baiting', 'Government, Civil society', 'https://blog.lookout.com/stealth-mango', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'cobroc5h');
INSERT INTO `dsdetails` VALUES ('966', 'Targeting of the office of U.S. Senator Claire McCaskill', '7/26/2018', 'Believed to be the work of APT 28', 'The office of U.S. Senator Claire McCaskill (D-MO) announced that it was targeted by Russian state-sponsored cyber actors, following a report of the incident in the Daily Beast.', '', 'United States', 'Russian Federation', 'Baiting', 'Government', 'https://www.thedailybeast.com/russian-hackers-new-target-a-vulnerable-democratic-senator', '2d9b83b92f2e776f1739e294b65eb04b68197120', '4uvezfqm');
INSERT INTO `dsdetails` VALUES ('967', 'Compromise of Marriott International', '11/30/2018', 'Suspected to be the work of Chinese operatives working for the Ministry of State Security.', 'Marriott reported a massive data breach that affected up to five hundred million customers in its Starwood hotels reservation system. U.S. private investigators believe China is behind the hack.', '', 'Marriott International Inc', 'China', 'Baiting', 'Private sector', 'https://www.nytimes.com/2018/12/11/us/politics/trump-china-trade.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'qp2d9pic');
INSERT INTO `dsdetails` VALUES ('968', 'Compromise of computer networks associated with the 2018 Pyeongchang Winter Olympics', '02-Dec-2018', 'Not Applicable', 'A threat actor, using a tool called Olympic Destroyer, successfully disrupted computer networks associated with the 2018 Winter Olympics in Pyeongchang, South Korea, before the opening ceremony. Among other things, the incident crashed the Wi-Fi network in the Olympic stadium and the press center.', '', 'Republic of Korea', 'Russian Federation', 'Vulnerabilities', 'Civil society', 'http://blog.talosintelligence.com/2018/02/olympic-destroyer.html', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '7uxtvscl');
INSERT INTO `dsdetails` VALUES ('969', 'Thrip', '6/19/2018', 'Also known as Billbug and Lotus Blossom.', 'This threat actor targets organizations in the satellite communications, telecommunications, geospatial-imaging, and defense sectors in the United States and Southeast Asia for Baiting purposes.', '', 'United States', 'China', 'Baiting', 'Private sector', 'https://www.symantec.com/blogs/threat-intelligence/thrip-hits-satellite-telecoms-defense-targets', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'pp8fgaog');
INSERT INTO `dsdetails` VALUES ('970', 'Cobalt Dickens', '8/24/2018', 'Also known as the Silent Librarian. Believed to be associated with the Mabna Institute.', 'This threat actor targets universities around the world for Baiting purposes.', '', 'Australia, Canada, China, Israel, Japan, Switzerland, Turkey, United Kingdom, United States', 'Iran (Islamic Republic of)', 'Baiting', 'Civil society', 'https://www.secureworks.com/blog/back-to-school-cobalt-dickens-targets-universities', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'bdkpriuk');
INSERT INTO `dsdetails` VALUES ('971', 'UK targeting of the Islamic State group', '04-Dec-2018', 'Believed to be associated with the U.S. targeting of the Islamic State Group.', 'The United Kingdoms Government Communications Headquarters director announced that, along with the UK Ministry of Defense, it had conducted a â€œmajor offensive cyber campaignâ€? directed at the Islamic State, with the purpose of disrupting the groups ability to recruit and coordinate. The UK campaign mirrors a previous one announced by the U.S. government in 2016.', '', 'Islamic State Group', 'United Kingdom', 'Vulnerabilities', 'Civil society', 'https://www.gchq.gov.uk/sites/default/files/Director%20GCHQ%20speech%20CyberUK%202018.pdf', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '6c2wttxg');
INSERT INTO `dsdetails` VALUES ('972', 'Targeting of Westinghouse Electric Corporation', '10-Apr-2018', 'Believed to be the work ofÂ APT 28', 'A threat actor targeted Westinghouse Electric Company, a nuclear power developer, for Baiting purposes. One of the individuals alleged to be behind this incident, believed to be Russian military intelligence (known as GRU), was indicted by the U.S. Justice Department.', 'Criminal charges   https://www.justice.gov/opa/pr/us-charges-russian-gru-officers-international-hacking-and-related-influence-and', 'Westinghouse Electric Company', 'Russian Federation', 'Baiting', 'Private sector', 'https://www.justice.gov/opa/pr/us-charges-russian-gru-officers-international-hacking-and-related-influence-and', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'uxbbmga2');
INSERT INTO `dsdetails` VALUES ('973', 'Targeting of North Korean defectors and journalists', '5/15/2018', 'Believed to be associated with the Lazarus Group', 'A threat actor targets North Korean defectors and journalists with an interest in North Korea by compromising their Android devices, for Baiting.', '', 'South Korea', 'Korea (Democratic Peoples Republic of)', 'Baiting', 'Civil society', 'https://securingtomorrow.mcafee.com/mcafee-labs/north-korean-defectors-journalists-targeted-using-social-networks-kakaotalk/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'xlpzmgkf');
INSERT INTO `dsdetails` VALUES ('974', 'Raspite', '08-Feb-2018', 'Not Applicable', 'This threat actor targets entities that operate industrial control systems in the electric utility sector.', '', 'United States', '', 'Baiting', 'Private sector', 'https://www.dragos.com/blog/20180802Raspite.html', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'pxvrqxxf');
INSERT INTO `dsdetails` VALUES ('975', 'Attempt to compromise Ukraines judicial system', '12-Apr-2018', 'Believed to be the work of a Russian hacking group.', 'Ukraines security agency thwarted an attack attempting to target the countrys court system.', '', 'Ukraine', 'Russian Federation', 'Baiting', 'Government', 'https://www.apnews.com/6eb40bb43cc74c6eb5b9e386ee62aa20', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'k3jxvzfi');
INSERT INTO `dsdetails` VALUES ('976', 'APT 37', '2/20/2018', 'Also known as Reaper and Group 123', 'This threat actor uses social engineering techniques to target companies in the chemicals, electronics, manufacturing, aerospace, automotive, and health-care sectors, as well as the South Korean government.', '', 'Republic of Korea, Japan, Vietnam', 'Korea (Democratic Peoples Republic of)', 'Phishing', 'Government, Private sector', 'https://www.fireeye.com/blog/threat-research/2018/02/apt37-overlooked-north-korean-actor.html', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', '2xd4n0kv');
INSERT INTO `dsdetails` VALUES ('977', 'Targeting of German critical infrastructure sectors', '06-Jul-2018', 'Believed to be the work of Crouching Yeti', 'A threat actor targeted critical infrastructure entities in the energy, water, and telecommunications sectors, prompting the German government to issue a public alert. In remarks following the alerts release, the head of Germanys domestic intelligence agency accused Russia of controlling the targeting campaign.', 'Denouncement   https://www.reuters.com/article/us-germany-cyber-russia/german-intelligence-sees-russia-behind-hack-of-energy-firms-media-report-idUSKBN1JG2X2', 'Germany', 'Russian Federation', 'Baiting', 'Private sector', 'https://www.verfassungsschutz.de/embed/broschuere-2018-06-bfv-cyber-brief-2018-01-neu.pdf', '2d9b83b92f2e776f1739e294b65eb04b68197120', '7yymjeoz');
INSERT INTO `dsdetails` VALUES ('978', 'Targeting of Omar Abdulaziz', '10-Jan-2018', 'Not Applicable', 'A threat actor targeted the iPhone of Omar Abdulaziz, a critic of the Kingdom of Saudi Arabia living in Canada, for Baiting purposes. The threat actor uses the Pegasus tool, created by the NSO Group.', '', 'Omar Abdulaziz', 'Saudi Arabia', 'Baiting', 'Civil society', 'https://citizenlab.ca/2018/10/the-kingdom-came-to-canada-how-saudi-linked-digital-Baiting-reached-canadian-soil/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'igqgdgl6');
INSERT INTO `dsdetails` VALUES ('979', 'Compromise of Mongolian government data center', '6/13/2018', 'Not Applicable', 'A threat actor has compromised a government data center in Mongolia. Kaspersky Lab assesses that the threat actor used its access to compromise websites that they will use in subsequent watering-hole attacks.', '', 'Mongolia', 'China', 'Baiting', 'Government', 'https://www.cyberscoop.com/apt27-mongolia-kaspersky/', '2d9b83b92f2e776f1739e294b65eb04b68197120', '8gb55fwd');
INSERT INTO `dsdetails` VALUES ('980', 'Alleged Russian compromise of networking equipment', '4/16/2018', 'Believed to be associated with Sandworm. Also known as VPNFilter.', 'The U.S. Department of Homeland Security and the UK National Cyber Security Centre issued a joint alert warning of a Russian state-sponsored campaign to compromise networking equipment, such as routers and switches, to support their cyber operations. A few weeks later, the FBI took control of a botnet with over five hundred thousand compromised devices and issued a public request that individuals with certain router models restart them.', 'Sanctions   https://home.treasury.gov/news/press-releases/sm0410', 'Worldwide, United States, United Kingdom, Ukraine', 'Russian Federation', 'Vulnerabilities', 'Private sector', 'https://www.us-cert.gov/ncas/alerts/TA18-106A', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '9nmmu3pd');
INSERT INTO `dsdetails` VALUES ('981', 'Gorgon Group', '08-Feb-2018', 'Not Applicable', 'This threat actor targets government entities in the United States and Europe. It also conducts criminal operations.', '', 'United States, Spain, Russian Federation, United Kingdom', '', 'Baiting', 'Government', 'https://researchcenter.paloaltonetworks.com/2018/08/unit42-gorgon-group-slithering-nation-state-cybercrime/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'zpkrjg99');
INSERT INTO `dsdetails` VALUES ('982', 'Targeting of the Parliament of Australia', '12-Jul-2018', 'Unknown', 'An attack targeted computer systems in both houses of the Parliament of Australia. The systems of the ruling Liberal-National Coalition Party and Labor, the main opposition party, were compromised, but there is no evidence of electoral interference.', '', 'Australia', '', 'Vulnerabilities', 'Government', 'https://www.wsj.com/articles/iran-blamed-for-cyberattack-on-australias-parliament-11550736796', '-3e7997cdc11e8ada64b2cc18b3c17bde4469f74b', '6xvfy4wc');
INSERT INTO `dsdetails` VALUES ('983', 'Compromise of an air-gapped German government network', '2/28/2018', 'Not Applicable', 'A threat actor compromised the Informationsverbund Berlin-Bonn, a computer network air gapped from the global internet, used by the German chancellery, parliament, Foreign Office, and other government departments based in Bonn, Germany.', 'Denouncement   https://www.reuters.com/article/us-germany-security/moscow-likely-behind-hack-on-german-govt-spy-chief-says-idUSKBN1HI19D', 'Germany', 'Russian Federation', 'Baiting', 'Government', 'http://www.dw.com/en/germany-admits-hackers-infiltrated-federal-ministries-russian-group-suspected/a-42775517', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'g28eq99t');
INSERT INTO `dsdetails` VALUES ('984', 'RedAlpha', '6/26/2018', 'Believed to use similar infrastructure as the NetTraveler, Icefog, and APT 17 threat actors', 'This threat actor targets Tibetan organizations based in India, for the purpose of Baiting.', '', 'India', 'China', 'Baiting', 'Civil society', 'https://www.recordedfuture.com/redalpha-cyber-campaigns/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'bdw5ke4i');
INSERT INTO `dsdetails` VALUES ('985', 'Targeting of congressional campaigns for the 2018 U.S. midterm elections', '7/19/2018', 'Believed to be the work of APT 28', 'A threat actor targets the campaigns of candidates running for Congress in the 2018 U.S. midterm elections.', '', 'Candidates for the U.S. Congress', 'Russian Federation', 'Baiting', 'Government', 'https://www.youtube.com/watch?v=NlCJokZcwJA', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'lid5gfdx');
INSERT INTO `dsdetails` VALUES ('986', 'Targeting of South Korean actors prior to meeting of Donald J. Trump and Kim Jong-un', '06-May-2018', 'Believed to be the work of TempTickÂ and Turla', 'Two separate threat actors targeted South Korean government organizations prior to the meeting between U.S. President Donald J. Trump and North Korean leader Kim Jong-un, for the purpose of Baiting.', '', 'South Korea', 'China, Russian Federation', 'Baiting', 'Government', 'https://www.wsj.com/articles/south-korea-fends-off-chinese-russian-cyberattacks-u-s-researcher-says-1528194642', '2d9b83b92f2e776f1739e294b65eb04b68197120', '6rgm3c4s');
INSERT INTO `dsdetails` VALUES ('987', 'Indictment of officials from the Mabna Institute', '3/28/2018', 'Not Applicable', 'The U.S. Department of Justice indicted nine officials from the Mabna Insititute, an Iranian company alleged to have conducted state-sponsored cyber operations on behalf of the Iranian Revolutionary Guards. They are alleged to have compromised the networks of over 144 U.S. universities, 176 universities in over twenty-one other countries, as well as private sector, government, and multilateral entities.', 'Criminal charges   https://www.justice.gov/opa/pr/nine-iranians-charged-conducting-massive-cyber-theft-campaign-behalf-islamic-revolutionary', 'United States, United Nations, UNICEF, Australia, Canada, China, Denmark, Germany, Ireland, Israel, Italy, Japan, Malaysia, Netherlands, Norway, Poland, Singapore, Republic of Korea, Spain, Sweden, Switzerland, Turkey, United Kingdom', 'Iran (Islamic Republic of)', 'Baiting', 'Government, Civil society, Private sector', 'https://www.justice.gov/opa/pr/nine-iranians-charged-conducting-massive-cyber-theft-campaign-behalf-islamic-revolutionary', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'mciwp44p');
INSERT INTO `dsdetails` VALUES ('988', 'Rancor', '6/26/2018', 'Believed to use similar tools as DragonOK', 'This threat actor uses spear-phishing techniques to target political organizations in Southeast Asia, for the purpose of Baiting.', '', 'Singapore, Cambodia', 'China', 'Baiting', 'Government, Civil society', 'https://researchcenter.paloaltonetworks.com/2018/06/unit42-rancor-targeted-attacks-south-east-asia-using-plaintee-ddkong-malware-families/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'hgucg09f');
INSERT INTO `dsdetails` VALUES ('989', 'Targeting of Yahya Assiri', '08-Jan-2018', 'Not Applicable', 'A threat actor targeted Yahya Assiri, a critic of the Kingdom of Saudi Arabia and a researcher at Amnesty International, for Baiting purposes. The threat actor used the Pegasus tool, created by the NSO Group.', '', 'Yahya Assiri', 'Saudi Arabia', 'Baiting', 'Civil society', 'https://www.amnesty.org/en/latest/research/2018/08/amnesty-international-among-targets-of-nso-powered-campaign/', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'cqqpvn1q');
INSERT INTO `dsdetails` VALUES ('990', 'Compromise of SingHealth, a large health-care provider in Singapore', '7/20/2018', 'Believed to be the work of Whitefly.Â ', 'A threat actor compromises the networks of SingHealth, the largest health-care provider in Singapore. Personal data of over 1.5 million patients was compromised, including the pharmaceutical prescriptions of 160,000 people.', '', 'SingHealth', '', 'Baiting', 'Private sector', 'https://www.reuters.com/article/us-singapore-cyberattack/singapore-disconnects-healthcare-computers-from-the-internet-after-cyber-attack-idUSKBN1KE15X', '2d9b83b92f2e776f1739e294b65eb04b68197120', 'e9t09xus');
INSERT INTO `dsdetails` VALUES ('991', 'TempTick', '06-May-2018', 'Believed to be responsible for the targeting of South Korean actors prior to the meeting of Donald J. Trump and Kim Jong-un.', 'This threat actor targets organizations in the finance, defense, aerospace, technology, health-care, and automotive sectors and media organizations in East Asia for the purpose of Baiting. This threat actor is also known for targeting a South Korean company that produces USB sticks generally used to transfer data to air-gapped networks.', '', 'South Korea, Japan', 'China', 'Phishing', 'Government, Private sector', 'https://www.wsj.com/articles/south-korea-fends-off-chinese-russian-cyberattacks-u-s-researcher-says-1528194642', '3e9e68a2f267f45f970ee84ff5dac37d05761f60', '6w8qcv1c');
